// --- Abrir menú Gestión Financiera ---
cy.visit("/inventario");
// --- Validar que estamos en la página de Inventario ---
cy.url().should("include", "/inventario");
// --- Abrir modal de reporte del segundo producto disponible ---
cy.get('button[data-original-title="Generar reporte"]').first().click();
// --- Trabajar dentro del modal visible ---
cy.get("div.modal-dialog:visible").within(() => {
  // --- Ingresar fecha inicial ---
  cy.get('input[name="fecha_inicial"]').clear().type("2025-10-01");
  // --- Ingresar fecha final ---
  cy.get('input[name="fecha_final"]').clear().type("2025-12-07");
  // --- Generar reporte en PDF ---
  cy.get('button[value="pdf"]').click();
  // --- Generar reporte en Excel ---
  cy.get('button[value="excel"]').click();
});
// --- Validación opcional: el modal sigue visible mientras se genera el reporte ---
cy.get("div.modal-dialog:visible").should("exist");
